PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "accounts_customuser" ("password" varchar(128) NOT NULL, "user_id" varchar(8) NOT NULL PRIMARY KEY, "username" varchar(255) NOT NULL UNIQUE, "email" varchar(255) NULL UNIQUE, "phone_number" varchar(32) NULL UNIQUE, "is_parent" bool NOT NULL, "is_student" bool NOT NULL, "is_teacher" bool NOT NULL, "is_admin" bool NOT NULL, "is_active" bool NOT NULL, "is_staff" bool NOT NULL, "is_superuser" bool NOT NULL, "date_joined" datetime NOT NULL, "last_login" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "accounts_customuser_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customuser_id" varchar(8) NOT NULL REFERENCES "accounts_customuser" ("user_id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "accounts_customuser_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customuser_id" varchar(8) NOT NULL REFERENCES "accounts_customuser" ("user_id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "Admin" ("user_id" varchar(8) NOT NULL PRIMARY KEY REFERENCES "accounts_customuser" ("user_id") DEFERRABLE INITIALLY DEFERRED, "full_name" varchar(255) NOT NULL, "sex" varchar(32) NULL, "day_of_birth" date NULL, "nation" varchar(32) NULL, "active_status" varchar(355) NULL, "contract_types" varchar(255) NULL, "expertise_levels" varchar(255) NULL, "description" varchar(32) NULL);
CREATE TABLE IF NOT EXISTS "Parent" ("user_id" varchar(8) NOT NULL PRIMARY KEY REFERENCES "accounts_customuser" ("user_id") DEFERRABLE INITIALLY DEFERRED, "full_name" varchar(255) NOT NULL, "address" varchar(255) NULL);
CREATE TABLE IF NOT EXISTS "Teacher" ("user_id" varchar(8) NOT NULL PRIMARY KEY REFERENCES "accounts_customuser" ("user_id") DEFERRABLE INITIALLY DEFERRED, "full_name" varchar(255) NOT NULL, "sex" varchar(32) NULL, "day_of_birth" date NULL, "nation" varchar(32) NULL, "active_status" varchar(355) NULL, "contract_types" varchar(255) NULL, "expertise_levels" varchar(255) NULL, "subjects" text NULL);
CREATE TABLE IF NOT EXISTS "Student" ("user_id" varchar(8) NOT NULL PRIMARY KEY REFERENCES "accounts_customuser" ("user_id") DEFERRABLE INITIALLY DEFERRED, "full_name" varchar(255) NOT NULL, "sex" varchar(32) NULL, "day_of_birth" date NULL, "nation" varchar(32) NULL, "active_status" varchar(355) NULL, "parent_id" varchar(8) NULL REFERENCES "Parent" ("user_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" varchar(8) NOT NULL REFERENCES "accounts_customuser" ("user_id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "room" ("name" varchar(127) NOT NULL PRIMARY KEY, "homeroom_teacher_id" varchar(8) NOT NULL REFERENCES "Teacher" ("user_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "seating_position" ("student_id" varchar(8) NOT NULL PRIMARY KEY REFERENCES "Student" ("user_id") DEFERRABLE INITIALLY DEFERRED, "row" integer NOT NULL, "column" integer NOT NULL, "room_id" varchar(127) NOT NULL REFERENCES "room" ("name") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "room_student" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "room_id" varchar(127) NOT NULL REFERENCES "room" ("name") DEFERRABLE INITIALLY DEFERRED, "student_id" varchar(8) NOT NULL REFERENCES "Student" ("user_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "adminpanel_period" ("number" integer NOT NULL PRIMARY KEY, "start_time" time NOT NULL, "end_time" time NOT NULL);
CREATE TABLE IF NOT EXISTS "semester" ("semester" integer NOT NULL PRIMARY KEY, "day_begin" date NOT NULL, "number_of_weeks" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "study_week" ("id" varchar(10) NOT NULL PRIMARY KEY, "week_number" integer NOT NULL, "semester_id" integer NOT NULL REFERENCES "semester" ("semester") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "adminpanel_plannedlesson" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "subject" varchar(20) NOT NULL, "lesson_number" integer NOT NULL, "name_lesson" varchar(100) NOT NULL, "room_id" varchar(127) NOT NULL REFERENCES "room" ("name") DEFERRABLE INITIALLY DEFERRED, "semester_id" integer NOT NULL REFERENCES "semester" ("semester") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "grades" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "subject" varchar(20) NOT NULL, "score_type" varchar(10) NOT NULL, "grade" real NOT NULL, "student_id" varchar(8) NOT NULL REFERENCES "Student" ("user_id") DEFERRABLE INITIALLY DEFERRED, "semester_id" integer NOT NULL REFERENCES "semester" ("semester") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "authtoken_token" ("key" varchar(40) NOT NULL PRIMARY KEY, "created" datetime NOT NULL, "user_id" varchar(8) NOT NULL UNIQUE REFERENCES "accounts_customuser" ("user_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "adminpanel_lesson" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "subject" varchar(20) NOT NULL, "name_lesson" varchar(100) NOT NULL, "day" date NULL, "comment" text NULL, "evaluate" integer NULL, "room_id" varchar(127) NOT NULL REFERENCES "room" ("name") DEFERRABLE INITIALLY DEFERRED, "teacher_id" varchar(8) NULL REFERENCES "Teacher" ("user_id") DEFERRABLE INITIALLY DEFERRED, "period_id" integer NULL REFERENCES "adminpanel_period" ("number") DEFERRABLE INITIALLY DEFERRED, "semester_id" integer NOT NULL REFERENCES "semester" ("semester") DEFERRABLE INITIALLY DEFERRED, "lesson_number" integer NULL);
CREATE TABLE IF NOT EXISTS "attendance" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "status" integer NULL, "attendance_time" datetime NOT NULL, "lesson_id" bigint NOT NULL REFERENCES "adminpanel_lesson" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" varchar(8) NOT NULL REFERENCES "accounts_customuser" ("user_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "attendance_device" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "device_id" varchar(50) NOT NULL UNIQUE, "room_id" varchar(127) NULL REFERENCES "room" ("name") DEFERRABLE INITIALLY DEFERRED);
